import React from "react";

import { Router, Routes, Route } from "react-router-dom";
import Home from "./Home";
import About from "./About";
const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" component={<Home/>}/> 
        <Route path="/about" component={<About/>}/>

      </Routes>
    </Router>





  );
};

export default App;
